import React, { Component } from "react";
import { MDBAlert} from "mdbreact";
import { MDBDataTable } from 'mdbreact';
import { Line } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";
import "./index.css";


class App extends Component {

  state= {
    persons: "gygygygvyugyuvyghy",
  }

  componentDidMount() {
    const apiUrl = 'https://www.quandl.com/api/v3/datasets/EOD/HD?api_key=VfK8ThGsxVxyz-sgZdCh&start_date=2017-12-01&end_date=2017-12-30';
    fetch(apiUrl)
      .then((response) => response.json())
      .then(data => {
        const persons = data.dataset;
        this.setState({ persons });
        console.log(persons);
      });
      // .then((data) =>  this.setState({ persons }), console.log('This is your data', azx.dataset.data));
  }
  render() {
    
    const data = {
      columns: [
        {
          label: 'Name',
          field: 'name',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Position',
          field: 'position',
          sort: 'asc',
          width: 270
        },
        {
          label: 'Office',
          field: 'office',
          sort: 'asc',
          width: 200
        },
        {
          label: 'Age',
          field: 'age',
          sort: 'asc',
          width: 100
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        }, {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Salary',
          field: 'salary',
          sort: 'asc',
          width: 100
        }
      ],
      rows: this.state.persons.column_names + " : " +  " " +  this.state.persons.data
    };
  
    return (

      
        <div className="container-fluild">
          <MDBAlert color="primary">
               <h1>Fraym FS position - skill test</h1>
          </MDBAlert>
           <div className="card p-3">
             <h1></h1>
             <MDBDataTable
              striped
              bordered
              small
              data={data}
              />
           </div>

           <div className="container-fluild">
            <div className="card p-3">
                <h3 className="mt-5">Fraym FS position - skill test  </h3>
                <ul>
                {this.state.persons.column_names} 
                     
                </ul>

                <table>
                  <tr>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                    <th></th>
                  </tr>
                </table>
                
                
                <p>visualize the historical trend of end of day stock prices for publicly</p>
                {/* <Line data={this.state.dataLine} options={{ responsive: true }} /> */}
              </div>
            </div>
        </div>
    );
  }
}

export default App;
